import React, { Component } from 'react'
import {Helmet,Parent} from "react-helmet";
import './MyTerminal.css'

class MyTerminal extends Component {

  render() {
    return (
        <Parent>
            <Helmet>
              <head>
                <title>My Title</title>
              </head>
            </Helmet>
        </Parent>


    );
}
}

export default MyTerminal;
